import React from 'react'
import TourCard from "./components/TourCard";

function App() {
  return (
    <React.Fragment>
       <nav className="navbar navbar-dark bg-dark navbar-expand-sm">
         <a href="/" className="navbar-brand">React with Bootstrap</a>
       </nav>
      <TourCard/>
    </React.Fragment>
  );
}

export default App;
